import React, { useState, useEffect, useCallback } from 'react';
import { 
  bookingsList, 
  usersList, 
  registrationsList 
} from '../../services/api';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { 
  FiUsers, 
  FiCalendar, 
  FiHome, 
  FiDollarSign,
  FiTrendingUp,
  FiTrendingDown,
  FiSearch,
  FiActivity
} from 'react-icons/fi';

export default function ManagerReports() {
  const [reports, setReports] = useState({
    totalUsers: 0,
    activeBookings: 0,
    availablePlots: 0,
    occupiedPlots: 0,
    recentBookings: [],
    monthlyRevenue: 0,
    plotUtilization: 0,
    totalPlots: 50
  });

  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [searchQuery, setSearchQuery] = useState('');
  const [timeRange, setTimeRange] = useState('month');
  const [filteredBookings, setFilteredBookings] = useState([]);

  const tableHeaderStyle = {
    padding: '0.75rem 1rem',
    textAlign: 'left',
    fontWeight: '600',
    color: '#374151',
    backgroundColor: '#f9fafb',
    borderBottom: '1px solid #e5e7eb',
  };

  const tableCellStyle = {
    padding: '1rem',
    borderBottom: '1px solid #e5e7eb',
    color: '#4b5563',
  };

  const getStatusBadge = (status) => {
    const statusConfig = {
      active: { bg: 'bg-green-100', text: 'text-green-800' },
      pending: { bg: 'bg-yellow-100', text: 'text-yellow-800' },
      completed: { bg: 'bg-blue-100', text: 'text-blue-800' },
      cancelled: { bg: 'bg-red-100', text: 'text-red-800' },
    };

    const config = statusConfig[status] || { bg: 'bg-gray-100', text: 'text-gray-800' };

    return (
      <span className={`inline-flex items-center px-3 py-1 rounded-full text-xs font-medium ${config.bg} ${config.text}`}>
        {status.charAt(0).toUpperCase() + status.slice(1)}
      </span>
    );
  };

  const fetchReportData = useCallback(async () => {
    try {
      setLoading(true);
      setError('');

      const [bookingsRes, usersRes] = await Promise.all([
        bookingsList(),
        usersList()
      ]);

      const bookings = bookingsRes.bookings || [];
      const users = usersRes.users || [];
      const now = new Date();

      // Calculate active bookings and available plots
      const activeBookings = bookings.filter(b => new Date(b.endDate) >= now);
      const availablePlots = Math.max(0, 50 - activeBookings.length);

      // Prepare recent bookings data
      const recentBookings = bookings
        .filter(booking => new Date(booking.endDate) >= now)
        .sort((a, b) => new Date(a.startDate) - new Date(b.startDate))
        .slice(0, 5)
        .map(booking => ({
          ...booking,
          status: 'active', // Default status
          assignedTo: users.find(u => u._id === booking.userId) || { name: 'Unknown User' },
          lastMaintained: booking.updatedAt || booking.createdAt
        }));

      setReports({
        totalUsers: users.length,
        activeBookings: activeBookings.length,
        availablePlots,
        occupiedPlots: activeBookings.length,
        recentBookings,
        monthlyRevenue: activeBookings.length * 50, // Example calculation: $50 per plot
        plotUtilization: Math.round((activeBookings.length / 50) * 100),
        totalPlots: 50
      });

      setFilteredBookings(recentBookings);
    } catch (err) {
      const errorMessage = err.response?.data?.message || 'Failed to fetch report data. Please try again.';
      setError(errorMessage);
      toast.error(errorMessage);
      console.error('Error fetching report data:', err);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchReportData();
  }, [fetchReportData]);

  // Apply search filter
  useEffect(() => {
    if (searchQuery) {
      const filtered = reports.recentBookings.filter(booking => 
        booking.assignedTo.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
        booking._id.toLowerCase().includes(searchQuery.toLowerCase())
      );
      setFilteredBookings(filtered);
    } else {
      setFilteredBookings(reports.recentBookings);
    }
  }, [searchQuery, reports.recentBookings]);

  const renderOverview = () => (
    <div className="space-y-6">
      {/* Time Range Selector */}
      <div className="flex justify-between items-center">
        <h2 className="text-xl font-semibold text-gray-800">Dashboard Overview</h2>
        <div className="flex space-x-2 bg-gray-100 p-1 rounded-lg">
          {['day', 'week', 'month', 'year'].map((range) => (
            <button
              key={range}
              onClick={() => setTimeRange(range)}
              className={`px-3 py-1 text-sm font-medium rounded-md ${
                timeRange === range
                  ? 'bg-white text-indigo-600 shadow-sm'
                  : 'text-gray-600 hover:text-gray-800'
              }`}
            >
              {range.charAt(0).toUpperCase() + range.slice(1)}
            </button>
          ))}
        </div>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <StatCard 
          title="Total Users" 
          value={reports.totalUsers}
          icon={FiUsers}
          color="indigo"
          trend={12.5}
        />
        <StatCard 
          title="Active Bookings" 
          value={reports.activeBookings}
          icon={FiCalendar}
          color="green"
          trend={5.2}
        />
        <StatCard 
          title="Available Plots" 
          value={reports.availablePlots}
          subValue={`of ${reports.totalPlots}`}
          icon={FiHome}
          color="blue"
        />
        <StatCard 
          title="Monthly Revenue" 
          value={`$${(reports.monthlyRevenue || 0).toLocaleString()}`}
          icon={FiDollarSign}
          color="purple"
          trend={8.3}
        />
      </div>

      {/* Utilization Section */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        <div className="lg:col-span-2 bg-white rounded-lg shadow p-6">
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-lg font-medium text-gray-900">Plot Utilization</h3>
            <span className="text-sm text-gray-500">
              {Math.round((reports.occupiedPlots / reports.totalPlots) * 100)}% utilized
            </span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-2.5">
            <div 
              className="bg-indigo-600 h-2.5 rounded-full" 
              style={{ width: `${(reports.occupiedPlots / reports.totalPlots) * 100}%` }}
            ></div>
          </div>
          <div className="mt-4 grid grid-cols-2 gap-4">
            <div>
              <span className="text-sm text-gray-500">Occupied</span>
              <p className="text-lg font-semibold">{reports.occupiedPlots} <span className="text-sm text-gray-500">plots</span></p>
            </div>
            <div>
              <span className="text-sm text-gray-500">Available</span>
              <p className="text-lg font-semibold">{reports.availablePlots} <span className="text-sm text-gray-500">plots</span></p>
            </div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-4">Quick Actions</h3>
          <div className="space-y-3">
            <button className="w-full flex items-center justify-between p-3 rounded-lg border border-gray-200 hover:bg-gray-50 transition-colors">
              <div className="flex items-center">
                <div className="p-2 rounded-md bg-green-100 text-green-600 mr-3">
                  <FiCalendar className="h-5 w-5" />
                </div>
                <span className="text-sm font-medium">New Booking</span>
              </div>
              <svg className="h-5 w-5 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </button>
            <button className="w-full flex items-center justify-between p-3 rounded-lg border border-gray-200 hover:bg-gray-50 transition-colors">
              <div className="flex items-center">
                <div className="p-2 rounded-md bg-blue-100 text-blue-600 mr-3">
                  <FiUsers className="h-5 w-5" />
                </div>
                <span className="text-sm font-medium">Manage Users</span>
              </div>
              <svg className="h-5 w-5 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </button>
            <button className="w-full flex items-center justify-between p-3 rounded-lg border border-gray-200 hover:bg-gray-50 transition-colors">
              <div className="flex items-center">
                <div className="p-2 rounded-md bg-purple-100 text-purple-600 mr-3">
                  <FiActivity className="h-5 w-5" />
                </div>
                <span className="text-sm font-medium">View Analytics</span>
              </div>
              <svg className="h-5 w-5 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </div>
  );

  const renderRecentBookings = () => (
    <div className="bg-white rounded-lg shadow overflow-hidden">
      <div className="px-6 py-4 border-b border-gray-200 flex justify-between items-center">
        <div>
          <h3 className="text-lg font-medium text-gray-900">Upcoming Bookings</h3>
          <p className="mt-1 text-sm text-gray-500">Recent and upcoming plot reservations</p>
        </div>
        <button className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500">
          <svg className="-ml-1 mr-2 h-4 w-4" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 4v16m8-8H4" />
          </svg>
          New Booking
        </button>
      </div>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Plot</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">User</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Start Date</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">End Date</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {reports.recentBookings.length > 0 ? (
              reports.recentBookings.map((booking) => (
                <tr key={booking._id}>
                  <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                    {booking.plot?.plotNumber || 'N/A'}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {booking.user?.name || 'Unknown User'}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {new Date(booking.startDate).toLocaleDateString()}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {new Date(booking.endDate).toLocaleDateString()}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full 
                      ${
                        booking.status === 'confirmed' 
                          ? 'bg-green-100 text-green-800' 
                          : booking.status === 'pending'
                          ? 'bg-yellow-100 text-yellow-800'
                          : 'bg-red-100 text-red-800'
                      }`}>
                      {booking.status}
                    </span>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="5" className="px-6 py-4 text-center text-sm text-gray-500">
                  No upcoming bookings found
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );

  return (
    <div style={{ padding: '2rem', maxWidth: '1400px', margin: '0 auto' }}>
      <div style={{ marginBottom: '2rem' }}>
        <h1 style={{ fontSize: '1.875rem', fontWeight: '700', color: '#111827', marginBottom: '0.5rem' }}>
          Reports & Analytics
        </h1>
        <p style={{ color: '#6b7280', marginBottom: '1.5rem' }}>
          View system statistics and generate reports
        </p>
      </div>

      {error && (
        <div style={{
          background: '#fee2e2',
          color: '#b91c1c',
          padding: '1rem',
          borderRadius: '0.5rem',
          marginBottom: '1.5rem',
        }}>
          {error}
        </div>
      )}

      <div className="mb-6">
        <div className="border-b border-gray-200">
          <nav className="-mb-px flex space-x-8">
            <button
              onClick={() => setActiveTab('overview')}
              className={`${
                activeTab === 'overview'
                  ? 'border-indigo-500 text-indigo-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
            >
              Overview
            </button>
            <button
              onClick={() => setActiveTab('bookings')}
              className={`${
                activeTab === 'bookings'
                  ? 'border-indigo-500 text-indigo-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
            >
              Bookings
            </button>
            <button
              onClick={() => setActiveTab('users')}
              className={`${
                activeTab === 'users'
                  ? 'border-indigo-500 text-indigo-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
            >
              Users
            </button>
            <button
              onClick={() => setActiveTab('plots')}
              className={`${
                activeTab === 'plots'
                  ? 'border-indigo-500 text-indigo-600'
                  : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
              } whitespace-nowrap py-4 px-1 border-b-2 font-medium text-sm`}
            >
              Plots
            </button>
          </nav>
        </div>
      </div>

      {loading ? (
        <div className="flex justify-center items-center py-12">
          <div className="animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-indigo-500"></div>
        </div>
      ) : (
        <div>
          {activeTab === 'overview' && (
            <>
              {renderOverview()}
              {renderRecentBookings()}
            </>
          )}
          {activeTab === 'bookings' && (
            <div className="bg-white rounded-lg shadow p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Bookings Report</h3>
              <p className="text-gray-600">Detailed booking reports coming soon.</p>
            </div>
          )}
          {activeTab === 'users' && (
            <div className="bg-white rounded-lg shadow p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Users Report</h3>
              <p className="text-gray-600">Detailed user reports coming soon.</p>
            </div>
          )}
          {activeTab === 'plots' && (
            <div className="bg-white rounded-lg shadow p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Plots Report</h3>
              <p className="text-gray-600">Detailed plot reports coming soon.</p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}
